import React from 'react';
import CertificateTable from './components/CertificateTable';

function App() {
  return (
    <div className="container mx-auto py-8">
      <h1 className="text-2xl font-bold mb-6">Certificates</h1>
      <CertificateTable />
    </div>
  );
}

export default App;
